import React from 'react';
import Button from './Button';

class Footer extends React.Component{
  render() {
    return(
     <div className='footer'>
      <h4>活動場所</h4>
      <h5><a href="https://www.youtube.com/channel/UC-sM1Mg7n_C48Odq5Xz83KA">youtubeチャンネル</a>
          <a href="https://twitter.com/Web510Game510">五戸アキのtwitterアカウント</a></h5>
          <a href="https://twitter.com/SANADA_NoiR">真田幸成のtwitterアカウント</a>
          <a href="https://twitter.com/tsuduri_tsuduru">立花ケヱタのtwitterアカウント</a>
          <a href="https://twitter.com/AIs36469011">永見コウキのtwitterアカウント</a>
      <div className="footer_button"><Button /></div>
     </div>
    );
  }
}

export default Footer;
